// Minimal stub of p5.js API required for the overlay prototype.
(function(global){
  function Sketch(setupFn){
    this.setup = setupFn;
  }
  global.p5 = function(sketch){
    const instance = new Sketch(function(){});
    global.setup = function(){ sketch(instance); };
    global.draw = function(){};
    setTimeout(function(){ if (global.setup) global.setup(); }, 0);
    return instance;
  };
})(this);
